 * 公益活动 分享我的公益
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('share-my-commonweal', {
 *   params: {
 *     totalWealActNum: 10,
 *     totalWealValue: 100,
